import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

//component
import ListLatestPlayers from '../../reportType/ListLatestPlayers'
import CardTopPlayers from '../../players/component/CardTopPlyers';
import ListReportsTypeOfRegion from '../../reportType/ListReportsTypeOfRegion';
import PieChartReportsTypeOfRegion from '../../component/PieChartReportsTypeOfRegion/PieChartReportsTypeOfRegion';
import CardLastReport from '../../component/CardLastReport/CardLastReport';
//css
import './homepage.scss'

const HomePage = () => {


    return (
        <Container fluid className='mt-5'> 
            <Row>
                <Col className='col-lg-3 list-top-players mr-2'>
                    <h5>Top reported</h5>
                    <CardTopPlayers />
                </Col>
                <Col className='col-lg-4 card-last-report mr-2'>
                    <h5>Last report</h5>
                    <CardLastReport/>
                </Col>
                <Col className='col-lg-auto list-reportType'>
                    <h5>All Report Type of Server</h5>
                    <PieChartReportsTypeOfRegion/>
                </Col>
            </Row>
        </Container>
    );

}
export default HomePage;
